import React from 'react';
import './Sidebar.css';

const Sidebar = ({ nickname }) => {
  return (
    <div className="Sidebar">
      <div className="Profile-picture">
        <img src="/path/to/profile-image" alt="Profile" />
      </div>
      <h2>{nickname}</h2>
      <a href="#" className="active">프로필 수정</a>
      <a href="#">스크랩</a>
      <a href="#">내가 쓴 글</a>
      <a href="#">공연 예약</a>
    </div>
  );
};

export default Sidebar;
